  false,\n\t\"url\": null,\n\t\"notes\": \"The following is excerpted from the metadata
  provided by NASS (USDA) for the source data set IN03NASS.TIF: \"The USDA-NASS 2003
  Indiana Cropland Data Layer is a raster, geo-referenced, categorized land cover
  data layer produced using satellite imagery from the Thematic Mapper (TM) instrument
  on Landsat 5 and the Enhanced Thematic Mapper (ETM+) on Landsat 7. The imagery was
  collected between the dates of April 11, 2003 and August 26, 2003. The approximate
  scale is 1:100,000 with a ground resolution of 30 meters by 30 meters. The Indiana
  data layer is aggregated to 13 standardized categories for display purposes with
  the emphasis being agricultural land cover. This is part of an annual series in
  which several states are categorized annually based on the extensive field observations
  collected during the annual NASS June Agricultural Survey. However, no farmer reported
  data is included or derivable on the Cropland Data Layer CD-ROM.\"\",\n\t\"license_title\":
